import "./barratopo.css";
import FotoLogo from "../../imagens/avatar.png";
import {Link} from "react-router-dom";
import { FiHome } from 'react-icons/fi';
import { FiInfo } from 'react-icons/fi';
import { FiMail } from 'react-icons/fi';
import { FiClipboard } from 'react-icons/fi';
import { FiLogOut } from 'react-icons/fi';

export default function BarraTopo() {

    return (
        <>


            <div className= "topo">


            <div className="topoEsquerda"></div>


            <div className="topoCentro">
                <ul className="topoLista">

                    <Link to="/">
                    <li className="topoListaItem">home</li>
                    </Link>

                    <Link to="/sobre">
                    <li className="topoListaItem">Sobre</li>
                    </Link>

                    <Link to="/musica">
                    <li className="topoListaItem">Musica</li>
                    </Link>



                    <li className="topoListaItem"><FiMail/></li>
                    <li className="topoListaItem"><FiClipboard/></li>
                    <li className="topoListaItem"><FiLogOut/></li>
                </ul>
            </div>

            <div className="topoDireita">
                <img
                    className="topImg"
                    src={FotoLogo} 
                    alt=""
                />
            </div>



          </div>
        </>
    )
}
